  {
    text: "Destination",
  },
  {
    text: "Tags",
  },
  {
    text: "Lead price",
  },
  {
    text: "Category",
  },
  {
    text: "Activities",
  },
];

const InputRow = (props: Props) => {
  return (
    <InputRowWrapper>
      <Dropdown
        options={dummyKeys}
        variant={"rectangle"}
        onSelect={(val:string) => console.log(val)}
      />
      <Button onClick={() => console.log("click")} text="+ Add rule" />
    </InputRowWrapper>
  );
}

export default InputRow
